  false,\n\t\"url\": null,\n\t\"notes\": \"Energy and mineral resources map of the
  Las Vegas SE quadrangle showing five categories of potential sand and gravel sources,
  present sources of sand and gravel, past sources of sand and gravel, two categories
  of potential rock-product sources, thermal water wells, exploratory oil wells, geothermal
  areas, and areas where dense population or intensive use would make future production
  of mineral resources unlikely. Other maps in the NBMG Urban Map series for the Las
  Vegas SE Quadrangle include Tinted relief (3Aa), Slope (3Ab), Land use (3Ac), Soils
  (3Ad), Vegetation (3Ae), Ground water (3Af), Geology (3Ag), Flood and related debris
  flow hazards (3Al), and Geologic constraints (3Am). See figure 3 for other quadrangles
  in the Urban Map series.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
